import Image from 'next/image'
import Link from 'next/link'

function Home() {
    return (
        <>
            <h1>My Homepage</h1>
            <Link href="/about"><a>About Page</a></Link>
            <Image
                src="/img/author.png"
                alt="Picture of the author"
                width={50}
                height={50}
            />
            <p>Welcome to my homepage!</p>
        </>
    )
}

export default Home
